instance Calculus Dipole80 where
    readRel str = read $ map Char.toUpper a ++ newB
        where
            (a,b) = splitAt 4 str
            newB = case b of
                "+"       -> "P"
                "-"       -> "M"
                otherwise -> map Char.toUpper b

    showRel rel = lowerA ++ case b of
                                "P"       -> "+"
                                "M"       -> "-"
                                otherwise -> b
        where
            (a,b) = splitAt 4 $ show rel
            lowerA = map Char.toLower a

